import React from "react";
import styles from "styles/Wave.module.css";

interface WaveProps {
  waveColor: string;
}

const Hero = (props: WaveProps) => {
  return (

        


    <svg
      width="100%"
      height="100%"
      viewBox="0 0 1440 400"
      xmlns="http://www.w3.org/2000/svg"
      className={styles.wave}
    >
      <path
        d="M 0,400 C 0,400 0,200 0,200 C 173.06666666666666,206.39999999999998 346.1333333333333,212.79999999999998 503,227 C 659.8666666666667,241.20000000000002 800.5333333333333,263.2 954,260 C 1107.4666666666667,256.8 1273.7333333333333,228.4 1440,200 C 1440,200 1440,400 1440,400 Z"
        stroke="none"
        stroke-width="0"
        fill={props.waveColor}
        className={styles.path}
      ></path>
    </svg>
  );
};

export default Hero;
